import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
const e = React.createElement;
function App() {
  return (
    e('div',{className:'container main'},
      e('div',{className:'row content'},
        e('div',{className:'col-md-6'},
          e('p',{},'Console'),
          e('div',{className:'console'})
        ),
        e('div',{className:'col-md-6'},'hi5dsa')
      )
    )
  );
}

export default App;
